import { StarIcon } from '@chakra-ui/icons'

interface Props {
  value: number
}

const Rating = ({ value }: Props) => {
  return (
    <>
      <StarIcon />
      <StarIcon ml={1} />
      <StarIcon ml={1} />
      <StarIcon ml={1} />
      <StarIcon ml={1} />
    </>
  )
}

export default Rating
